import React from "react";
import Navbar from "./Navbar";
import axios from "axios";
import jwt_decode from "jwt-decode";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  return (
    <div>
      <Navbar />
      <div className="container mt-5">
        <h1>Welcome Back : </h1>
      </div>
    </div>
  );
};

export default Dashboard;
